  (<div className="team-names">
    {teams}
    </div>)
    : null

  // const userPanel = users ?
  // (<div className="user-names">
  //   {users}
  //   </div>)
  //   : null

  return (
    <div className="App">
        {teamPanel}
        {/* {userPanel} */}
